select distinct COA_NAME,
	SOURCE_SEGMENT1,
	SOURCE_SEGMENT2,
	SOURCE_SEGMENT3,
	SOURCE_SEGMENT4,
	SOURCE_SEGMENT5,
	nvl(SOURCE_SEGMENT6,'00000') SOURCE_SEGMENT6,
	SOURCE_SEGMENT7,
	SOURCE_SEGMENT8,
	SOURCE_SEGMENT9,
	SOURCE_SEGMENT10,
	WSC_SEQ,
	TARGET_COA,
	WSC_SEQ_NUM
from 
  WSC_AHCS_COA_CONCAT_SEGMENT 
where wsc_seq_num is null;

--export data

delete from WSC_AHCS_COA_CONCAT_SEGMENT where wsc_seq_num is null;

REM INSERTING into WSC_AHCS_COA_CONCAT_SEGMENT
SET DEFINE OFF;


commit;
update wsc_ahcs_coa_concat_segment a
set a.TARGET_COA= WSC_GL_COA_MAPPING_PKG.COA_MAPPING('ANIXTER-INT','Oracle ERP Cloud',a.SOURCE_SEGMENT1,
a.SOURCE_SEGMENT2,a.SOURCE_SEGMENT3,a.SOURCE_SEGMENT4,a.SOURCE_SEGMENT5,nvl(a.SOURCE_SEGMENT6,'00000'),a.SOURCE_SEGMENT7,
a.SOURCE_SEGMENT8,null,null) 
where wsc_seq_num is null and COA_NAME='Anixter to Cloud';
commit;

commit;

update wsc_ahcs_coa_concat_segment set replace(target_coa, ' ','')
where wsc_seq_num is null and target_coa like '%.%';

commit;
